  import { React,useEffect,useState } from 'react';
  import './ProfilePage.css';
  import useToken from '../../service/UseToken'; 
  import ProtectedRoutes from '../../ProtectedRoutes';
  import { getCurrentUser } from '../../service/BackendService';
  import { Link, useNavigate } from 'react-router-dom'; 
  import { getToken } from '../../service/BackendService';

  const ProfilePage = () => {
    const { clearToken, token1 } = useToken(); 
    const [userData, setUserData] = useState(null);
    const navigate = useNavigate();
    const token = getToken()

   useEffect(() => {
  console.log('Token:', token);  

  const fetchUserData = async () => {
    try {
      const user = await getCurrentUser();
      console.log('User data received:', user); 
      setUserData(user);
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  if (token) {
    console.log('Calling fetchUserData');  
    fetchUserData();
  }
}, [token]);


      const handleLogout = () => {
          clearToken();
          navigate('/'); 
        }; 
    

  return (
      <div>
        <ProtectedRoutes/> 
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
    <a className="navbar-brand">Navbar</a>
    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNav">
      <ul className="navbar-nav">
        <li className="nav-item active">
        <Link to="/home" style={{ textDecoration: 'none' }}>
          <a className="nav-link">Home</a>
          </Link>      </li>

        <li className="nav-item">
        <Link to="/profile/friends" style={{ textDecoration: 'none' }}>
          <a className="nav-link">Friends</a>
          </Link>
            </li>

            <li className="nav-item">
        <Link to="/profile" style={{ textDecoration: 'none' }}>
          <a className="nav-link">Profile </a>
          </Link>
            </li>

        <li className="nav-item"> <button onClick={handleLogout} className="nav-link"> LOG OUT </button></li>   
      </ul>
    </div>


  </nav>


  <div className="container rounded bg-white mt-5 mb-5">
      <div className="row">
          <div className="col-md-3 border-right">
              <div className="d-flex flex-column align-items-center text-center p-3 py-5"><img className="rounded-circle mt-5" width="150px" src="https://st3.depositphotos.com/15648834/17930/v/600/depositphotos_179308454-stock-illustration-unknown-person-silhouette-glasses-profile.jpg"/>
              <span className="font-weight-bold">Edogaru</span><span> </span></div>
              <p><b>Change profile picture</b></p>
              <form action="/action_page.php">
    <input type="file" id="myFile" name="filename"/>
    </form>
          </div>
          <div className="col-md-5 border-right">
              <div className="p-3 py-5">
                  <div className="d-flex justify-content-between align-items-center mb-3">
                      <h4 className="text-right">Profile Settings</h4>
                  </div>
                  <div className="row mt-2">
              <div className="col-md-6">
                <label className="labels">Name</label>
                <input
                  type="text"
                  className="form-control"
                  placeholder="First Name"
                  value={userData?.firstName || ''}
                  readOnly
                />
              </div>               <div className="col-md-6"><label className="labels">Last Name</label><input type="text" className="form-control" placeholder="Last Name"/></div>
                  </div>
                  <div className="row mt-3">
                      <div className="col-md-12"><label className="labels">Email address</label><input type="text" className="form-control" placeholder="Email address"/></div>
                  </div>
                  <br/>

                  <h6 className="text-right">Change password </h6>
                  <div className="row mt-2">
                      <div className="col-md-6"><label className="labels">Old password</label><input type="password" className="form-control" placeholder="Old password"/></div>
                      <div className="col-md-6"><label className="labels">New password</label><input type="password" className="form-control" placeholder="New password"/></div>
                      <div className="col-md-6"><label className="labels">Repeat new password</label><input type="password" className="form-control" placeholder="Repeat new password"/></div>
                  </div>
                  <br/>

                  <p>Gender: <b>M</b></p>
              
                  <div className="mt-5 text-center"><button className="btn btn-primary profile-button" type="button">Save Profile</button></div>
              </div>
          </div>
        
      </div>
  </div>

  </div>

  );
  };

  export default ProfilePage;
